import React from 'react';
import { Link } from 'react-router-dom';

import './../styles/styles_sub.css';
import styles1 from './../styles/styles_sub.css';


function Sos () {
  return (
    <div className={styles1.body2} id='body2'>
      {/* Page Head */}
        {/* Encoding */}
        <meta charSet="UTF-8" name="viewport" content="width=device-width, initial-scale=1.0" />

        {/* Site Tab Title */}
        <title> sOS </title>

        {/* Fade Out Overlay */}
          <div className="overlay" id="overlay" />

        {/* Page Title */}
            {/* Header */}
            <header id="header">
              <Link to="/">
                <button id="gs-btn">GS</button>
              </Link>        
            </header>

      {/* Main */}
      <main>
          <div className="container">
          {/* Top Grid */}
          <div className="grid-1">
              {/* Section | S9 */}
              <section id="title">
              <h1> sOS </h1>
              </section>
              {/* Section | Brief */}
              <section className="section" id="brief">
              <h3> Description: <p> (Date of origin: 12/2024) </p> </h3>
              WIP, see link below <br />
              <a href="https://github.com/Shadowpatriot9/sOS"> Link </a>
              </section>
          </div>
          </div>
      </main>
      {/* Footer */}
      <footer> 
          {/* Copyright */}
          <div className="graphic">
          <p> Â© 2024 Grayden Scovil </p> 
          </div>
          {/* Love Note */}
          <div className="love-note">
            <p> 
              Made with 
              <svg fill="#000000" height="15px" width="23px" version="1.1" id="Capa_1" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" viewBox="-28.3 -28.3 528.30 528.30" xmlSpace="preserve" stroke="#000000" strokeWidth="33.01907"><g id="SVGRepo_bgCarrier" strokeWidth={0} /><g id="SVGRepo_tracerCarrier" strokeLinecap="round" strokeLinejoin="round" stroke="#CCCCCC" strokeWidth="18.86804" /><g id="SVGRepo_iconCarrier"> <g> <path d="M433.601,67.001c-24.7-24.7-57.4-38.2-92.3-38.2s-67.7,13.6-92.4,38.3l-12.9,12.9l-13.1-13.1 c-24.7-24.7-57.6-38.4-92.5-38.4c-34.8,0-67.6,13.6-92.2,38.2c-24.7,24.7-38.3,57.5-38.2,92.4c0,34.9,13.7,67.6,38.4,92.3 l187.8,187.8c2.6,2.6,6.1,4,9.5,4c3.4,0,6.9-1.3,9.5-3.9l188.2-187.5c24.7-24.7,38.3-57.5,38.3-92.4 C471.801,124.501,458.301,91.701,433.601,67.001z M414.401,232.701l-178.7,178l-178.3-178.3c-19.6-19.6-30.4-45.6-30.4-73.3 s10.7-53.7,30.3-73.2c19.5-19.5,45.5-30.3,73.1-30.3c27.7,0,53.8,10.8,73.4,30.4l22.6,22.6c5.3,5.3,13.8,5.3,19.1,0l22.4-22.4 c19.6-19.6,45.7-30.4,73.3-30.4c27.6,0,53.6,10.8,73.2,30.3c19.6,19.6,30.3,45.6,30.3,73.3 C444.801,187.101,434.001,213.101,414.401,232.701z" /> </g> </g></svg>
            </p>
          </div>  
      </footer>
    </div>
  );
}

export default Sos;
